DROP TABLE IF EXISTS `AmountRefundWay`;

CREATE TABLE `AmountRefundWay` (
  `ID` char(50) NOT NULL COMMENT 'ID和场馆ID主键关联',
  `Create_Time` datetime NOT NULL COMMENT '创建时间',
  `Modify_Time` datetime NOT NULL COMMENT '修改时间',
  `Fee1` int(3) NOT NULL DEFAULT '50' COMMENT '<2小时内费率',
  `Fee2` int(3) NOT NULL DEFAULT '0' COMMENT '2-4小时内费率',
  `Fee3` int(3) NOT NULL DEFAULT '0' COMMENT '4-6小时内费率',
  `Weather_start` int(3) NOT NULL DEFAULT '0' COMMENT '天气原因开始前',
  `weather_end` int(3) NOT NULL DEFAULT '50' COMMENT '天气原因开始后',
  PRIMARY KEY (`ID`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='退款方式表';

