/*Table structure for table `City` */

DROP TABLE IF EXISTS `City`;

CREATE TABLE `City` (
  `ID` char(32) NOT NULL COMMENT '系统->城市',
  `CityNo` int(11) NOT NULL AUTO_INCREMENT COMMENT '城市编号',
  `City` varchar(30) NOT NULL COMMENT '城市名',
  `Initial` char(1) DEFAULT NULL COMMENT '城市名首字母',
  `HotFlag` int(1) NOT NULL DEFAULT '0' COMMENT '是否热门0=否1=是',
  `MapFlag` int(1) NOT NULL DEFAULT '0' COMMENT '是否地图0=否1=是',
  `CityFlag` int(1) NOT NULL DEFAULT '0' COMMENT '是否开放0=否1=是',
  `VenueSum` int(11) NOT NULL DEFAULT '0' COMMENT '场馆数',
  PRIMARY KEY (`ID`),
  UNIQUE KEY `唯一` (`City`),
  KEY `CityNo` (`CityNo`)
) ENGINE=InnoDB AUTO_INCREMENT=798 DEFAULT CHARSET=utf8 COMMENT='城市表';

