/*Table structure for table `Venue` */

DROP TABLE IF EXISTS `Venue`;

CREATE TABLE `Venue` (
  `ID` char(32) NOT NULL COMMENT '场馆',
  `CreateTime` datetime NOT NULL COMMENT '创建时间',
  `ModifyTime` datetime DEFAULT NULL COMMENT '修改时间',
  `VenueNO` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '球场编号',
  `Name` varchar(100) DEFAULT NULL COMMENT '场馆名',
  `Address` varchar(100) DEFAULT NULL COMMENT '地址',
  `CityID` varchar(32) DEFAULT NULL COMMENT '城市',
  `DistrictID` varchar(32) DEFAULT NULL COMMENT '区县',
  `Owner` varchar(50) DEFAULT NULL COMMENT '联系人',
  `Contact_phone` varchar(50) DEFAULT NULL COMMENT '联系电话',
  `Inform_phone` varchar(50) DEFAULT NULL COMMENT '通知电话',
  `BallSum` int(1) DEFAULT NULL COMMENT '场地数量',
  `Image` varchar(300) NOT NULL DEFAULT 'https://ekeae-image.oss-cn-shenzhen.aliyuncs.com/baseImage/venue-default.jpg' COMMENT '封面',
  `WarmReminder` varchar(200) NOT NULL DEFAULT '大量空闲中，球友们约起来！有事退场请尽量提前，谢谢合作！' COMMENT '温馨提醒',
  `OrderVerify` int(1) NOT NULL DEFAULT '0' COMMENT '订场确认(0=人工确认1=自动确认)',
  `Longitude` double DEFAULT NULL COMMENT '经度',
  `Latitude` double DEFAULT NULL COMMENT '纬度',
  `Type` int(11) NOT NULL DEFAULT '1' COMMENT '球场类型(1=网球场2=足球场3=羽毛球馆4=篮球场)',
  `Train_add_flag` int(1) NOT NULL DEFAULT '0' COMMENT '入驻状态0=空1=添加',
  `TrainTeam` varchar(32) DEFAULT NULL COMMENT '培训机构ID',
  `ShowFlag` int(1) NOT NULL DEFAULT '2' COMMENT '状态(1=正常2=屏蔽)',
  `Min_amount` double DEFAULT NULL COMMENT '最低价格培训',
  `Reserve_show` int(1) NOT NULL DEFAULT '0' COMMENT '订场入口(0=否1=是)',
  `Reserve_sms` int(1) NOT NULL DEFAULT '0' COMMENT '订场短信(0=否1=是)',
  `Reserve_pay_sms` int(1) NOT NULL DEFAULT '0' COMMENT '订场支付短信(0=否1=是)',
  `Max_day` int(1) NOT NULL DEFAULT '3' COMMENT '最大显示订场天数',
  PRIMARY KEY (`ID`),
  KEY `VenueNO` (`VenueNO`)
