/*Table structure for table `VenueRefund` */

DROP TABLE IF EXISTS `VenueRefund`;

CREATE TABLE `VenueRefund` (
  `ID` varchar(32) NOT NULL COMMENT '退款',
  `Create_time` datetime NOT NULL COMMENT '创建时间',
  `Content` varchar(200) NOT NULL DEFAULT '无' COMMENT '退款理由',
  `Amount_sum` double(11,2) NOT NULL COMMENT '总金额',
  `Amount_refund` double(11,2) NOT NULL COMMENT '退款金额',
  `Amount_fee` double(11,2) NOT NULL DEFAULT '0.00' COMMENT '退款手续费',
  `Amount_rate` int(11) NOT NULL COMMENT '最高费率',
  `Order_id` varchar(32) NOT NULL COMMENT '订单ID',
  `Refund_time` datetime DEFAULT NULL COMMENT '退款时间',
  `Refund_status` int(1) NOT NULL DEFAULT '0' COMMENT '退款状态(0=申请中1=退款成功2=退款失败)',
  `Remark` varchar(100) DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`ID`)
