/*Table structure for table `VenueStatis` */

DROP TABLE IF EXISTS `VenueStatis`;

CREATE TABLE `VenueStatis` (
  `ID` char(32) NOT NULL COMMENT '场馆使用情况统计(排名用)',
  `CreateTime` datetime NOT NULL COMMENT '创建时间',
  `StatisDate` date NOT NULL COMMENT '统计日期',
  `VenueID` char(50) NOT NULL COMMENT '场馆ID',
  `Score` double(11,2) NOT NULL DEFAULT '0.00' COMMENT '使用比例',
  `Amount` double(11,2) NOT NULL DEFAULT '0.00' COMMENT '营业额',
  `Template_id` varchar(32) NOT NULL COMMENT '模板ID',
  `Field_id` varchar(50) DEFAULT NULL COMMENT '场地ID',
  PRIMARY KEY (`ID`)
