/*Table structure for table `WXBill` */

DROP TABLE IF EXISTS `WXBill`;

CREATE TABLE `WXBill` (
  `ID` varchar(32) NOT NULL COMMENT '微信支付',
  `Create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `Deal_time` datetime DEFAULT NULL COMMENT '交易时间',
  `WX_appid` varchar(50) DEFAULT NULL COMMENT '公众账号ID',
  `WX_mchid` varchar(50) DEFAULT NULL COMMENT '商户号',
  `Son_mchid` varchar(50) DEFAULT NULL COMMENT '子商户号',
  `Device_info` varchar(50) DEFAULT NULL COMMENT '设备号',
  `WX_orderid` varchar(50) DEFAULT NULL COMMENT '微信订单号',
  `Store_orderid` varchar(50) DEFAULT NULL COMMENT '商户订单号',
  `User_flag` varchar(50) DEFAULT NULL COMMENT '用户标识',
  `Pay_type` varchar(50) DEFAULT NULL COMMENT '交易类型',
  `Pay_status` varchar(50) DEFAULT NULL COMMENT '交易状态',
  `Payment_bank` varchar(50) DEFAULT NULL COMMENT '付款银行',
  `Currency_type` varchar(50) DEFAULT NULL COMMENT '货币种类',
  `Ought_order_amount` decimal(11,2) DEFAULT NULL COMMENT '应结订单金额',
  `Cash_coupon` decimal(11,2) DEFAULT NULL COMMENT '代金券金额',
  `WX_refund_orderid` varchar(50) DEFAULT NULL COMMENT '微信退款单号',
  `Store_refund_orderid` varchar(50) DEFAULT NULL COMMENT '商户退款单号',
  `Refund_amount` decimal(11,2) DEFAULT NULL COMMENT '退款金额',
  `Cash_coupon_refund` decimal(11,2) DEFAULT NULL COMMENT '充值卷退款金额',
  `Refund_type` varchar(50) DEFAULT NULL COMMENT '退款类型',
  `Refund_status` varchar(50) DEFAULT NULL COMMENT '退款状态',
  `Goods_name` varchar(100) DEFAULT NULL COMMENT '商品名称',
  `Store_data` varchar(100) DEFAULT NULL COMMENT '商户数据包',
  `Fee_amount` decimal(16,6) DEFAULT NULL COMMENT '手续费',
  `Rate` varchar(10) DEFAULT NULL COMMENT '费率',
  `Order_amount` decimal(11,2) DEFAULT NULL COMMENT '订单金额',
  `Apply_refund_amount` decimal(11,2) DEFAULT NULL COMMENT '申请退款金额',
  `Rate_remark` varchar(100) DEFAULT NULL COMMENT '费率备注',
  PRIMARY KEY (`ID`)
