/*Table structure for table `WXFundflow` */

DROP TABLE IF EXISTS `WXFundflow`;

CREATE TABLE `WXFundflow` (
  `ID` char(32) NOT NULL COMMENT 'ID',
  `Create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `Record_time` datetime DEFAULT NULL COMMENT '记账时间',
  `WX_pay_orderid` varchar(50) DEFAULT NULL COMMENT '微信支付业务单号',
  `WX_fundflow_id` varchar(50) DEFAULT NULL COMMENT '资金流水单号',
  `Work_name` varchar(100) DEFAULT NULL COMMENT '业务名称',
  `Work_type` varchar(50) DEFAULT NULL COMMENT '业务类型',
  `Deal_type` varchar(50) DEFAULT NULL COMMENT '收支类型',
  `Deal_amount` decimal(11,2) DEFAULT NULL COMMENT '收支金额(元)',
  `Account_amount` decimal(11,2) DEFAULT NULL COMMENT '账户结余(元)',
  `Apply_user` varchar(50) DEFAULT NULL COMMENT '资金变更提交申请人',
  `Remark` varchar(200) DEFAULT NULL COMMENT '备注',
  `Work_id` varchar(50) DEFAULT NULL COMMENT '业务凭证号',
  `Account_type` int(1) NOT NULL DEFAULT '1' COMMENT '1=基本账户2=运营账户3=手续费账户',
  PRIMARY KEY (`ID`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='微信资金对账表';

